import React from 'react'
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';

import  "./NavbarPage.scss";
export const NavbarPage = () => {

    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleClick = (event) => {
      setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
      setAnchorEl(null);
    };

    return (
        <div className="Navbar-Container">
            <div className="navbarKiri">
                <img src="https://www.equity.co.id/sites/default/files/logo-equity-life.jpg" alt=""/>
            </div>
            <div className="navbarKanan">
            <Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
                Profile
            </Button>
            <Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
                Layanan
            </Button>
            <Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
                Kanal Distribusi
            </Button>
            <Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
                Nav
            </Button>
            <Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
               Berita
            </Button>
            <Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
                DPLK
            </Button>
            <Menu
                id="simple-menu"
                anchorEl={anchorEl}
                keepMounted
                open={Boolean(anchorEl)}
                onClose={handleClose}
            >
                <MenuItem onClick={handleClose}>Profile</MenuItem>
                <MenuItem onClick={handleClose}>My account</MenuItem>
                <MenuItem onClick={handleClose}>Logout</MenuItem>
            </Menu>
            <Autocomplete
                id="grouped-demo"
                options={options.sort((a, b) => -b.firstLetter.localeCompare(a.firstLetter))}
                groupBy={(option) => option.firstLetter}
                getOptionLabel={(option) => option.title}
                style={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="With categories" variant="outlined" />}
                />
            </div>
        </div>
    )
}
